import React, { useState } from "react";
import "../Profile/Profile.css";
import { userStore } from "../../stores/UserStore";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react";

function Profile() {

    const [inputs, setInputs] = useState({});
    const navigate = useNavigate();
    const updateUserStore = userStore(state => state);
    const username = userStore(state => state);
    async function getUser() {  
        try {
            const response = await fetch(`http://localhost:8080/project_backend/rest/users/${username}`, {
                method: "GET",
                headers: {
                    "Content-Type": "application/json",
                    token: userStore(state => state.token)
                }
            });

            if (response.ok) {
                const user = await response.json();
                updateUserStore.updateEmail(user.email);
                updateUserStore.updateFirstName(user.firstName);
                updateUserStore.updateLastName(user.lastName);
                updateUserStore.updatePhone(user.phone);
                updateUserStore.updatePhotoURL(user.photoURL);

            }
            else {
                const responseBody = await response.text();
                console.error("Error getting user:", response.statusText, responseBody);
            }
        }
        catch (error) {
            console.error("Error getting user:", error);
        }
    }

    useEffect(() => {
        getUser();
    }, []);

    const user = userStore(state => state);

    
    const email = userStore(state => state.email);
    const firstName = userStore(state => state.firstName);
    const lastName = userStore(state => state.lastName);
    const phone = userStore(state => state.phone);
    const photoURL = userStore(state => state.photoURL);

    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;

        setInputs(values => ({...values, [name]: value}));
    }

    const handleSubmit = async (event) => {
        event.preventDefault();
        
        const user = {
            username: username,
            email: inputs.email,
            firstName: inputs.firstName,
            lastName: inputs.lastName,
            phone: inputs.phone,
            photoURL: inputs.photoURL
        };

        try {
            const response = await fetch(`http://localhost:8080/project_backend/rest/users/update/${username}`, {
                method: "PUT",
                headers: {
                    "Content-Type": "application/json",
                    token: userStore(state => state.token)
                },
                body: JSON.stringify(user),
            });

            if (response.ok) {
                const user = await response.json();
                updateUserStore.updateEmail(user.email);
                updateUserStore.updateFirstName(user.firstName);
                updateUserStore.updateLastName(user.lastName);
                updateUserStore.updatePhone(user.phone);
                updateUserStore.updatePhotoURL(user.photoURL);
                console.log("User:", user);
                console.log("Email:", user.email);
                console.log("First Name:", user.firstName);
                console.log("Last Name:", user.lastName);
                console.log("Phone:", user.phone);
                console.log("PhotoURL:", user.photoURL);

                navigate('/home', { replace: true });
            }
            else {
                const responseBody = await response.text();
                console.error("Error updating profile:", response.statusText, responseBody);
            }
        }
        catch (error) {
            console.error("Error updating profile:", error);
        }
    }


  return (
    <div>
      <div className="editProfilePanel">
      <label id="username-title-editProfile">{ username }</label>
            <form className="editProfile-register" id="edit-profile-form" onSubmit={handleSubmit}>
                <div className="editProfile-fieldsContainer">
                    <div className="left-fields-editProfile">
                        <label className="labels-edit-profile" id="email-editProfile-label">Email</label>
                        <input type="email" className="editProfile-fields" id="email-editProfile" name="email" onChange={handleChange} required value={user.email}></input>
                        <label className="labels-edit-profile" id="firstName-editProfile-label">First Name</label>
                        <input type="text" className="editProfile-fields" id="firstName-editProfile" name="firstName" onChange={handleChange} required value={ firstName }></input>
                        <label className="labels-edit-profile" id="lastName-editProfile-label">Last Name</label>
                        <input type="text" className="editProfile-fields" id="lastName-editProfile" name="lastName" onChange={handleChange} required value={ lastName }></input>
                        <label className="labels-edit-profile" id="phone-editProfile-label">Phone</label>
                        <input type="text" className="editProfile-fields" id="phone-editProfile" name="phone" onChange={handleChange} required value={ phone }></input>
                        <label className="labels-edit-profile" id="photoURL-editProfile-label">Photo URL</label>
                        <input type="url" className="editProfile-fields" id="photoURL-editProfile" name="photoURL" onChange={handleChange} required value={ photoURL }></input>
                    </div>
                </div>
                <div className="editProfile-Buttons">
                        <button type="submit" id="profile-save-button">Save</button>
                        <button type="reset" id="profile-cancel-button">Cancel</button>
                </div>
            </form>
            </div>
    </div>
  );
}

export default Profile;
